def merge_the_tools(string, k):
    result = []
    number_elements = len(string) // (len(string) // k)
    last_position = None

    for i in range(len(string)):
        position_in_array = i // number_elements

        if last_position != position_in_array:
            result.append(string[i])
            last_position = position_in_array
        elif string[i] not in result[position_in_array]:
            result[position_in_array] += string[i]

    for i in range(len(result)):
        print(result[i])


string = ""
k = 3452
merge_the_tools(string, k)
